import React from 'react'
import Table from "./Table";

const data = [
    { reportID: 1, serviceName: "HTTP", connectionDuration: "1:25", attackerIP: "10.0.2.100", trapName: "Admin", sessionINFO: "hello world" },
    { id: 2, name: "Jane Smith", age: 30, gender: "jane@example.com", country: "London" },
    { id: 3, name: "Bob Johnson", age: 40, gender: "bob@example.com", country: "Paris" },
    { id: 4, name: "Mary Williams", age: 35, gender: "mary@example.com", country: "Sydney" },
    { id: 5, name: "Tom Lee", age: 28, gender: "tom@example.com", country: "Hong Kong" }
];

function Home() {



    return (
        <div id="reports">
            <h2>Report</h2>
            <br/>
            <Table data={data}></Table>
        </div>
    );
}

export default Home;
